  entities:
  - uid: 1008
    components:
    - type: Transform
      pos: 20.026821,1.6532679
      parent: 1
    - type: Paper
      content: >-
        В лучах огромного светила

        Волна играет новизной.

        Меня маман моя растила,

        Ты ж стала мне моей женой.
             Ах, Жозефина, Жозефина!
             Ты для меня цветок зари!
             Хочу, чтоб сына подарила,
             Мне очень нужен сын, пойми!
        Мой сын мне нужен как наследник,

        Будет красавец в мать свою.

        Он станет первым и последним,

        Тебе ж я сердце отдаю.
  - uid: 1009
    components:
    - type: Transform
      pos: 6.3819885,-4.6017737
      parent: 1
    - type: Paper
      content: >2

        Как-то раз в Карибском море

        Захватили мы фрегат

        Он достался нам без боя

        Ликовал в ту ночь пират

        Нас не мучили вопросы

        Почему на корабле

        Ни единого матроса

        Не скрывается во мгле?

        Дни весёлые настали — дьявол круто пошутил

        Очень скоро мы узнали

        Что корабль проклят был
  - uid: 2037
    components:
    - type: Transform
      pos: 24.78921,3.7569928
      parent: 1
    - type: Paper
      content: >-
        Над водою стелется туман непроходимый

        Сбился капитан с пути, безумием водимый

        Слышит голос нежный и знакомый уж до боли

        Красоте её лица противиться неволен

        За бортом девица! Попробуй не влюбиться!

        Слух ласкает песни звон, ему лучше смириться

        За бортом девица! Он хочет утопиться!

        Всё готов отдать пират, чтоб с ней губами слиться!
  - uid: 2092
    components:
