      rot: 3.141592653589793 rad
      pos: -15.083161,-6.596067
      parent: 1
    - type: Paper
      content: 'Когда пираты сказали Цезарю, что просят за него выкуп в сумме 20 талантов, он посмеялся над ними и предположил, что 50 талантов в качестве выкупа будут более подходящей суммой. Затем он послал свою свиту собрать нужное количество денег и поселился у пиратов в плену. '
